import React, { useState } from "react";

import "./App.css";
import Input from "./Components/Input";

function App() {
  const [data, setData] = useState("");
  return (
    <div>
    <h1>Input Component</h1>
      <Input
        type="text"
        value={(e: any) => {
          setData(e.target.value);
        }}
      />
      <p> InputValue : {data}</p>
    </div>
  );
}

export default App;
